#nexit

artistic practice should be available to the whole of society, regardless of income, location or social background. people before profit are calling for the following measures:





➡️ create a national cultural fund to increase state funding of the arts to the european average of 0.6 percent of gdp;





➡️ fund access to arts participation in disadvantaged areas for adults and children and those with disabilities;





➡️ open schools and colleges for after-school artistic activities for children and teenagers;





➡️ open public spaces for use by local arts organisations;





➡️ support live music. live music venues are a vital part of our cultural life. we will cut rates on pubs that have regular live music;





➡️ support performances and exhibitions in public spaces;





➡️ create arts participation programmes in prisons, schools, care homes and hospitals;





➡️ remove the requirement of ‘availability for work’ for artists on jobseeker’s allowance;





➡️ create a ‘new deal’ programme for artists in the public sector. this would create well-paid jobs and increase access to the arts throughout society.
